import React from "react";

import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";

const handleBack = () => {
  navigate("/"); // ホームページに戻る
};

const navigate = useNavigate();

const ResultPage = ({ pin }) => (
  
  <div>
    <h1>Results</h1>
    {pin ? (
      <div>
        <p>Pin Position:</p>
        <p>X: {pin.x.toFixed(2)}</p>
        <p>Y: {pin.y.toFixed(2)}</p>
      </div>
    ) : (
      <p>No pin set</p>
    )}
    <button
          onClick={handleBack}
          style={{
            position: "absolute",
            top: 100,
            left: 100,
            zIndex: 1000,
            backgroundColor: "#28A745",
            color: "#fff",
            border: "none",
            borderRadius: "5px",
            padding: "10px 20px",
            cursor: "pointer",
          }}
        >
          Back
        </button>
  </div>
);

export default ResultPage;
